V. A. W. Hillier, Peter Coombes and David Rogers, &quot;Hillier's Fundamentals of Motor Vehicle Technology: Powertrain Electronics (Bk. 2), 5 edition&quot;
N.lson Th.rnes | 2006 | ISBN: 0748780998 | 246 pages | PDF 

Book 2 covers those electronic controlled systems that have been introduced in recent years and provides expanded and detailed explanations of new and advanced vehicle technologies. This work is aligned to N/SVQ Level 3 but is also suitable for the higher levels of Technical Certificate.
